import React from "react";

import * as styles from "./App.module.css";

console.log(styles)

function App() {
  return (
    <div className={styles.app}>
      <main className={styles.appMain}>
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
      </main>
    </div>
  );
}

export default App;
